var w = $("#"+id);


w.find('> .content').html(widget('layout:tabs', {
    tabs: [
        {
            label: 'bundles',
            color: '#f00',
            content: function() {
                return widget('dev:bundles');
            },
            show_first: true
        }, {
            label: 'untracked rows',
            content: function() {
                return widget('ide:bundle_untracked');
            }
        }
    ],
    selected_tab_color: '#ccc'
}));

var w = $("#"+id);

endpoint.schema('bundle').table('bundle').rows().then(function(bundles) {
    var items = Array();
	bundles.forEach(function(bundle) {
        items.push(bundle);
    });

    w.html(widget('layout:list_view', {
        items: items,
        item_name: function(bundle) {
            return bundle.get('name');
        },
        item_detail: function(bundle) {
            return widget('dev:bundle', { bundle: bundle });
        }
    }));    
});

var w = $("#"+id);

bundle.related_rows('id','bundle.head_db_stage','bundle_id').then(function(head_db_stage) {
    var rows = [];

    head_db_stage.forEach(function(row) {
        rows.push(row);
    });

    console.log(rows);


    w.html(widget('layout:list_view_multiselect', {
        items: rows,
        item_name: function(item) {
            return item.get('row_id');
        },
        item_detail: function(item) {
            return widget('bundle_row', {
                row: item
            });
        }
    }));
});

